INSERT INTO `duyurular` (`duyuruID`, `duyuruBasligi`, `duyuruAciklama`) VALUES
(1, 'DERS iPTAL\r\n', 'Bilgilendirme yapmak isteriz ki, yarınki dersimiz iptal edilmiştir. Önümüzdeki hafta dersler normale dönecek olup, herhangi bir değişiklik durumunda sizi bilgilendireceğiz. Anlayışınız için teşekkür ederiz.'),
(2, 'ANNELER GÜNÜ', 'Her yıl Mayıs ayının ikinci Pazar günü kutlanır. Annelerin ve annelik bağlarının önemini vurgular.'),
(5, 'Ders Programı Değişikliği', 'Bu hafta içinde ders programında bir değişiklik olmayacaktır. Ancak, gelecek hafta için olası değişiklikler hakkında sizi bilgilendireceğiz. Lütfen duyuruları takip edin.'),
(6, 'Atatürk\'ü Anma, Gençlik ve Spor Bayramı', '19 Mayıs Atatürk\'ü Anma, Gençlik ve Spor Bayramı\'nı okulumuzda coşkuyla kutlayacağız. Öğrencilerimize bu anlamlı günü anlamaları için çeşitli etkinlikler planlanmıştır.');

