--

INSERT INTO `hakkimizda_card` (`hakkimizdaID`, `tarihce_foto`, `tarihce_aciklama`, `h_misyon_foto`, `h_misyon_aciklama`, `h_vizyon_foto`, `h_vizyon_aciklama`, `h_hedef_foto`, `h_hedef_aciklama`) VALUES
(1, , 'Bizim Pırıltı Bire Bir Etüt Merkezi, eğitimde fark yaratma amacıyla yola çıkan bir grup eğitimci tarafından kurulmuştur. Merkezimiz, öğrencilerin bireysel ihtiyaçlarına odaklanarak onlara en iyi eğitim hizmetini sunmayı hedeflemektedir.\r\n\r\nKuruluşumuzun temel amacı, öğrencilere akademik başarılarını artırmaları için gereken desteği sağlamaktır. Bu amaçla, her öğrencinin öğrenme tarzına, hızına ve ihtiyaçlarına uygun özelleştirilmiş bir eğitim programı sunuyoruz.\r\n\r\nBizim Pırıltı Bire Bir Etüt Merkezi, öğrencilerin sadece derslerinde değil, aynı zamanda genel gelişimlerinde de destek olmayı amaçlamaktadır. Bu nedenle, sadece akademik konularla sınırlı kalmayıp, öğrencilerin sosyal ve duygusal gelişimlerine de önem veriyoruz.\r\n\r\nMerkezimizde görev yapan eğitimciler, alanlarında uzman ve deneyimli kişilerden oluşmaktadır. Öğrencilere en iyi eğitimi sunabilmek için sürekli olarak kendilerini güncel tutmakta ve öğrencilerle yakın bir ilişki kurarak onların gereksinimlerini anlamaya çalışmaktadırlar.\r\n\r\nBizim Pırıltı Bire Bir Etüt Merkezi olarak, öğrencilerimizin sadece sınavlarda değil, hayatları boyunca başarılı olmalarını hedefliyoruz. Onlara güvenli ve destekleyici bir ortamda öğrenmeyi sevdirmek ve başarılarını maksimize etmek için çalışıyoruz.', , 'Öğrencilerimize en kaliteli eğitimi sunarak onların başarılarına ışık tutmak.', , 'Her öğrencinin potansiyeline inanarak onları en üst seviyeye taşımak.', , 'Öğrencilerimizin bireysel başarılarını maksimize ederek geleceğe ışık tutmak.');

